import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux"; //
import { Link } from "react-router-dom";
import "./Home.css";
import {
  getDogs,
  getTemperament,
  filterDogsByTemperament,
  // filterCreated,
  // orderByName,
  // orderByWeight,
} from "../actions";
import Card from "./Card";
import Paginado from "./Paginado";

const Home = () => {
  const dispatch = useDispatch();
  // const allDogs = useSelector((state) => state.dogs);
  const [dogs, setDogs] = useState([]);
  //me trae del reducer el estado dogs
  const allDogs = useSelector((state) => state.dogs);
  const allTemperament = useSelector((state) => state.temperament);

  //paginado
  const [currentPage, setCurrentPage] = useState(1); //lo seteamos en 1

  //vamos hacer otro estado local me va a indicar cuantos personajes tengo por pagina
  const [dogsPerPage, setDogsPage] = useState(8);

  //me declaro una constante que se va a llamar indice del ultimo personaje
  const indexOfLastDog = currentPage * dogsPerPage; //vale 8*1=8 posicion array
  //va ser igual a la pagina actual donde estoy * por la cantidad de personaje por pagina

  //indice del primer personaje
  const indexOfFirstDog = indexOfLastDog - dogsPerPage; //0

  const currentDogs = dogs.slice(indexOfFirstDog, indexOfLastDog); //le decimos al slice agarra el indice del 1er dog y el indice del ultimo dog
  //los personajes que estan en la pag actual y que me guarde los personaje de cada pag

  const paginado = (pageNumber) => {
    //esta constante paginado es la que me a ayudar al renderizado
    setCurrentPage(pageNumber);
  };

  useEffect(() => {
    const fetchDogData = async () => {
      try {
        const res = await fetch("https://api.thedogapi.com/v1/breeds");
        const data = await res.json();
        setDogs(data);
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    };
    fetchDogData();
  }, []);

  useEffect(() => {
    dispatch(getDogs());
    dispatch(getTemperament());
  }, [dispatch]);

  function handleClick(e) {
    //e es evento
    e.preventDefault();
    dispatch(getDogs()); //me lo resetea
  }

  // function handleFilterTemperament(e) {
  //   e.preventDefault();
  //   dispatch(filterDogsByTemperament(e.target.value));
  //   // setCurrentPage(1);
  //   // setOrder(e.target.value);
  // }

  // function handleFilterCreated(e) {
  //   e.preventDefault();
  //   dispatch(filterCreated(e.target.value)); //el payload
  //   setCurrentPage(1);
  //   // setOrder(e.target.value);
  // }

  function handlefilterStatus(e) {
    dispatch(filterDogsByTemperament(e.targer.value));
  }

  return (
    <div className="fondo">
      <Link className="create_button" to="/dog">
        Create Dog
      </Link>
      <button
        onClick={(e) => {
          handleClick(e);
        }}
      >
        Volver a Cargar todos los Dogs
      </button>

      <select>
        <option value="Asc">A-Z</option>
        <option value="Desc">Z-A</option>
      </select>
      <select onChange={(e) => filterDogsByTemperament(e)}>
        <option value="temperament">Temperaments</option>
        <option value="All">All</option>

        {allTemperament.map((temperament) => (
          <option key={temperament.name} value={temperament.name}>
            {temperament.name}
          </option>
        ))}
      </select>

      <select>
        <option value="Weight">Weight</option>
        <option value="Heavy">Heavy</option>
        <option value="Light">Light</option>
      </select>

      <select>
        <opcion>Todos</opcion>
        <opcion>Creados</opcion>
        <opcion>De la Api</opcion>
      </select>

      <Paginado
        dogsPerPage={dogsPerPage}
        dogs={dogs.length}
        paginado={paginado}
      />

      <div className="cards">
        {currentDogs?.map((el) => {
          return (
            <Card
              key={el.id}
              id={el.id}
              name={el.name}
              image={el.image.url}
              temperament={el.temperament}
              weight={el.weight.metric}
              height={el.height}
            />
          );
        })}
      </div>
    </div>
  );
};

export default Home;

